package pdf

import (
	"encoding/base64"
	"github.com/shuangdeyu/helper_go/comhelper"
	"github.com/signintech/gopdf"
	"log"
)

func CreatePdfByGopdf() {
	underspace := 54.0 // 页面底部间距
	upperspace := 54.0 // 页面顶部间距
	leftspace := 50.4  // 页面左间距
	rightspace := 50.4 // 页面右间距
	fontsize := float64(11)
	cell := []map[string]interface{}{
		{
			"range":     "A1:A1",
			"fieldName": "name",
			"x":         "0",
			"y":         "0",
			"height":    "13.8",
			"width":     "48",
		}, {
			"range":     "B1:B1",
			"fieldName": "action",
			"x":         "48",
			"y":         "0",
			"height":    "13.8",
			"width":     "48",
		},
	}
	record := []map[string]interface{}{
		{
			"area": "A2:B2",
			"name": "xp",
			"record": []map[string]interface{}{
				{
					"field":  "A",
					"name":   "io",
					"x":      "0",
					"y":      "13.8",
					"height": "13.8",
					"width":  "48",
				}, {
					"field":  "B",
					"name":   "cr",
					"x":      "48",
					"y":      "13.8",
					"height": "13.8",
					"width":  "48",
				},
			},
		},
	}
	images := []map[string]interface{}{
		{
			"height": "112.2",
			"width":  "176.7",
			"x":      "148.8",
			"y":      "16.8",
			"path":   "",
			"name":   "0Picture 2",
			"base":   "",
		},
	}
	body := []map[string]interface{}{
		{
			"height": "13.8",
			"width":  "48",
			"x":      "0",
			"y":      "41.4",
			"text":   "jj",
			"size":   "20",
		}, {
			"height": "13.8",
			"width":  "48",
			"x":      "48",
			"y":      "41.4",
			"text":   "ioio",
		}, {
			"height": "13.8",
			"width":  "48",
			"x":      "48",
			"y":      "69.6",
			"text":   "こんにちは 你好呀!",
		},
	}

	pdf := gopdf.GoPdf{}
	// 不加密
	pdf.Start(gopdf.Config{PageSize: gopdf.Rect{W: 595.28, H: 841.89}}) //595.28, 841.89 = A4
	// 加密
	/*pdf.Start(gopdf.Config{
		PageSize: gopdf.Rect{W: 595.28, H: 841.89}, //595.28, 841.89 = A4
		Protection: gopdf.PDFProtectionConfig{
			UseProtection: true,
			Permissions:   gopdf.PermissionsPrint | gopdf.PermissionsCopy | gopdf.PermissionsModify | gopdf.PermissionsAnnotForms,
			OwnerPass:     []byte("1234"),
			UserPass:      []byte("5555")},
	})*/

	pdf.AddPage()
	err := pdf.AddTTFFont("simsun", "./pdf/ttf/simsun.ttf")
	if err != nil {
		log.Print(err.Error())
		return
	}
	err = pdf.SetFont("simsun", "", fontsize)
	if err != nil {
		log.Print(err.Error())
		return
	}

	// set body
	for _, v := range body {
		if size, ok := v["size"].(string); ok && size != "" {
			pdf.SetFontSize(comhelper.StringToFloat(size, 64))
		}
		x := realX(comhelper.StringToFloat(v["x"].(string), 64), leftspace, rightspace)
		y := realX(comhelper.StringToFloat(v["y"].(string), 64), upperspace, underspace)
		pdf.SetXY(x, y)
		//pdf.Cell(nil, v["text"].(string))

		width := comhelper.StringToFloat(v["width"].(string), 64)
		height := comhelper.StringToFloat(v["height"].(string), 64)
		// 虽然Rect未生效，但必须设置了之后CellOption才能生效
		pdf.CellWithOption(&gopdf.Rect{W: width, H: height}, v["text"].(string), gopdf.CellOption{
			Align: gopdf.Middle,
		})
		// 还原字体大小
		pdf.SetFontSize(fontsize)
	}

	// set cell
	for _, v := range cell {
		x := realX(comhelper.StringToFloat(v["x"].(string), 64), leftspace, rightspace)
		y := realX(comhelper.StringToFloat(v["y"].(string), 64), upperspace, underspace)
		pdf.SetXY(x, y)
		//pdf.Cell(nil, v["text"].(string))

		width := comhelper.StringToFloat(v["width"].(string), 64)
		height := comhelper.StringToFloat(v["height"].(string), 64)
		// 虽然Rect未生效，但必须设置了之后CellOption才能生效
		pdf.CellWithOption(&gopdf.Rect{W: width, H: height}, v["fieldName"].(string), gopdf.CellOption{
			Align: gopdf.Bottom,
		})
	}

	// set record
	for _, v := range record {
		name := v["name"].(string)
		if r, ok := v["record"].([]map[string]interface{}); ok {
			for _, rv := range r {
				x := realX(comhelper.StringToFloat(rv["x"].(string), 64), leftspace, rightspace)
				y := realX(comhelper.StringToFloat(rv["y"].(string), 64), upperspace, underspace)
				pdf.SetXY(x, y)
				//pdf.Cell(nil, v["text"].(string))

				width := comhelper.StringToFloat(rv["width"].(string), 64)
				height := comhelper.StringToFloat(rv["height"].(string), 64)
				// 虽然Rect未生效，但必须设置了之后CellOption才能生效
				pdf.CellWithOption(&gopdf.Rect{W: width, H: height}, name+rv["name"].(string), gopdf.CellOption{
					Align: gopdf.Middle,
				})
			}
		}
	}

	// set image
	for _, v := range images {
		imgByte, err := base64.StdEncoding.DecodeString(v["base"].(string))
		if err == nil {
			imgH1, err := gopdf.ImageHolderByBytes(imgByte)
			if err != nil {
				log.Print(err.Error())
				continue
			}
			x := realX(comhelper.StringToFloat(v["x"].(string), 64), leftspace, rightspace)
			y := realX(comhelper.StringToFloat(v["y"].(string), 64), upperspace, underspace)
			pdf.ImageByHolder(imgH1, x, y, &gopdf.Rect{
				W: comhelper.StringToFloat(v["width"].(string), 64),
				H: comhelper.StringToFloat(v["height"].(string), 64),
			})
		}
	}

	/*ret, err := pdf.GetBytesPdfReturnErr()
	if err != nil {
		log.Print(err.Error())
		return
	}
	log.Println(ret)*/
	pdf.WritePdf("hello.pdf")
}

func realX(x, leftX, rightX float64) float64 {
	x = x + leftX
	if x > (595.28 - rightX) {
		x = 595.28 - rightX
	}
	return x
}

func realY(y, topY, bottomY float64) float64 {
	y = y + topY
	if y > (841.89 - bottomY) {
		y = 841.89 - bottomY
	}
	return y
}
